import React from 'react';

 const uri = 'http://localhost:3001'; 



class Rank extends React.Component {
  constructor() {
    super();
    this.state = {
      users: []
    }
    }

    componentDidMount() {
      fetch(uri + '/score', {
        method: 'get',
        headers: {'Content-Type': 'application/json'},
            })
            .then(response => response.json())
            .then(data => this.setState({users: data}))
      .catch(err => console.log(err));
    }

render() {
  const { users } = this.state;
	return(
		 <div>
		 	<div className='white f3 flex pa2 pl7'>
		 	<ol>
 			 <li> {users[0]}: {} entries</li>
 			 <li> {users[1]}: {} entries</li>
 			 <li> {users[2]}: {} entries</li>
 			 <li> {users[3]}: {} entries</li>
 			 <li> {users[4]}: {} entries</li>
			</ol>
     		</div>
		 </div>
		);
}
}



export default Rank;
